* {margin: 0; padding: 0;
    font-family: 'Uchen', serif;}
li {list-style: none;}
a {color: black; text-decoration: none;}
img {display: block;}



/*-------------header-------------*/
.header {
    width: 100%; height: 300px;
    border-bottom: 1px solid black;
}
.header .gnb {
    width: 1276px; height: 50px;
    margin: 0 auto;
}
.header .gnb ul {
    width: 150px; height: 50px;
    float: right;
}
.header .gnb ul li {
    width: 30px; height: 50px;
    float: left;
    text-align: center;
    line-height: 50px;
    position: relative;
    font-size: 30px;
    margin-right: 20px;
}
#search_btn {display: none;}
#search_btn:checked ~ .search_sheet {
    display: block;
}
#search_btn ~ .search_sheet {
    display: none;
}
.search_sheet {
    position: absolute;
    top: -7px; left: 40px;
}
.search01 {
    border: 1px solid #666;
    border-radius: 10px;
    padding: 5px;
    font-weight: bold;
}

.header .logo {
    width: 957px; height: 135px;
    margin: 0 auto;
    margin-bottom: 70px;
    font-size: 150px;
    text-align: center;
    line-height: 135px;
    font-family: 'Uchen', serif;
}
.header .logo a {color: black;}

.header .lnb {
    width: 600px; height: 40px;
    margin: 0 auto;
}

.header .lnb .lnb_box>li {
    width: 100px; height: 40px;
    float: left;
    text-align: center; 
    line-height: 40px;
    font-size: 35px;
    margin-left: 40px;
    font-family: 'Uchen', serif;
}

.header .lnb .lnb_box .lnb_menu {
    margin-left: 55px;
}
.header .lnb ul li a:hover {
    color: #F50AAE;
}

.header .lnb ul li:hover li {display: block;}

.header .lnb ul ul li {display: none;}
.header .lnb ul ul li {
    width: 180px; height: 40px;
    font-size: 19px;
    text-align: center;
    line-height: 45px;
    background-color: #ffff;
    float: left;
    border: 1px solid black;
}
.header .lnb ul ul li:first-child {
    margin-top: 7px;
}
/*---------best item----------*/

.sub_box {
    width: 100%;
    text-align: center;
    margin-top: 100px;
    margin-bottom: 50px;
}
.sub_title {
    font-size: 35px;
    font-weight: bold;
}
.sub_box ul li {
    display: inline-block;
    border-right: 1px solid #ccc;
    padding-right: 15px;
    padding-left: 10px;
    text-align: center;
    box-sizing: border-box;
}
.sub_box ul li:hover a{
    color: #F50AAE;
}

.sub_box ul li:last-child {border-right: 0;}
.best_pro {
    width:65%;
    margin: 0 auto;
    display: flex;
    margin-top: 50px;
}
.best_box {
    margin: 0 auto;
    text-align: center;
    font-family: 'Uchen', serif;
    cursor: pointer;
}
.best_pro span {
    margin-right: 20px;
}
.rad_box div{font-family: 'Noto Serif KR', serif;}
.phone_sheet {
    margin: 0 auto;
    width: 1280px;
    height: 800px;
    overflow: hidden;
    
}
.phone_sheet div {
    float: left;
    margin-right: 10px;
    margin-bottom: 60px;
}
.phone01 {
    margin-top: 100px;
    margin-bottom: 50px;
    margin-left: 350px;
}
.phone_sheet span {
    margin-right: 20px;
}
.main_box {
    width: 310px;
    height: 370px;
    cursor: pointer;
    text-align: center;
}


/*-----page------*/

.page {
    width: 360px; height: 80px;
    margin: 0 auto;
    margin-top: 100px;
    overflow: hidden;
}
.page div {
    width: 40px; height: 40px;
    float: left;
    border: 1px solid #666;
    box-sizing: border-box;
    text-align: center;
    font-family: 'Uchen', serif;
    line-height: 40px;
    margin-bottom: 40px;
}

/*-------footer-------*/
.ko {font-family: 'Noto Serif KR', serif;}
.footer {
    width: 100%; height: auto;
}
.footer .foot1 {
    width: 100%; height: 30px;
    border-bottom: 1px solid black;
}
.footer .foot1 ul {
    width: 600px; height: 30px;
    margin: 0 auto;
}
.footer .foot1 ul li {
    display: inline;
    padding: 5px;
    font-size: 13px;
    box-sizing: border-box;
    line-height: 30px;
    font-family: 'Noto Serif KR', serif;
}
.footer .foot1 ul li a {
    font-family: 'Noto Serif KR', serif;
}
.footer .foot1 ul li:first-child {
    margin-left: 70px;
}
.footer .foot2 {
    width: 800px; height: 130px;
    margin: 0 auto;
    overflow: hidden;
}
.footer .foot2 .footer_left {
    width: 250px; height: 120px;
    font-size: 14px;
    margin-left: 40px;
    margin-top: 10px;
    font-family: 'Uchen', serif;
    float: left;
}
.footer .foot2 .font {
    font-size: 20px;
    font-style: italic;
    font-weight: bold;
}
.footer .foot2 .footer_right {
    width: 450px; height: 120px;
    float: left;
    margin-left: 30px;
    font-size: 14px;
    margin-top: 10px;
    line-height: 20px;
    font-family: 'Uchen', serif;
}
.footer .foot3 {
    width: 100%; height: 40px;
}
.footer .foot3 div {
    width: 600px; height: 40px;
    margin: 0 auto;
    font-size: 13px;
    text-align: center;
    font-family: 'Uchen', serif;
}

/*-------wing_banner--------*/
.body {position: relative;}
.wing_banner {
    width: 40px; height: 280px;
    position: fixed;
    top: 300px; right: 0;
    background-color: white;
    
}
.wing_banner a {
    width: 40px; height: 40px;
    float: left;
    box-sizing: border-box;
    text-align: center;
    line-height: 40px;
    position: relative;

}
.wing_banner .kakao img{
   width: 100%; height: 100%;
}
.wing_banner .wing_txt {
    width: 70px; height: 20px;
    line-height: 20px;
    text-align: center;
    position: absolute;
    border-radius: 5px;
    border: 1px solid black;
    top: 10px; right: 45px;
    font-family: 'Noto Serif KR', serif;
    font-size: 11px;
    background-color: white;
    margin-bottom: 5px;
    display: none;
}
.wing_banner a:hover .wing_txt {
    display: block;
}
